import "../../../styles/Partials/_home.scss"
import Header from "../../Layout/Header/index"
import Footer from "../../Layout/Footer/index"

export default function About() {
  return (
    <div>
        <h2>About Me</h2>
        <p>Heyo, Thanks for stopping by. I develop beautiful and engaging applications that are accessible and responsive. Prior to this, I graduated from University of Waterloo with a honours bachelor of science in biomedical science and joint honours in psychology. 

            I am a lifetime learner, whether its expanding my coding skills or working on side projects. When I'm not coding, I run my small start up 
        </p>
    </div>
  );
}
